/*Table structure for table `ae_sitepages` */

CREATE TABLE `ae_sitepages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `page_name` char(50) DEFAULT NULL,
  `page_desc` char(50) DEFAULT NULL,
  `need_login` int(11) DEFAULT '1',
  `need_rights` int(11) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `ae_sitepages` */

/*Table structure for table `ae_userrights` */

CREATE TABLE `ae_userrights` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `utype` int(11) DEFAULT NULL,
  `page` int(11) DEFAULT NULL,
  `rights` char(4) DEFAULT NULL COMMENT 'VAMD',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `ae_userrights` */

/*Table structure for table `ae_users` */

CREATE TABLE `ae_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fullname` varchar(100) DEFAULT NULL,
  `password` varchar(100) DEFAULT NULL COMMENT 'md5(pwd.md5(rand)):md5(rand)',
  `email` varchar(100) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `lastActivity` datetime DEFAULT NULL,
  `status` enum('PENDING','ACTIVE','BLOCKED') DEFAULT NULL COMMENT 'pending/active/blocked',
  `utype` int(11) DEFAULT NULL,
  `membertype` enum('A','R','C') DEFAULT NULL COMMENT 'Admin/Resorts/Customers',
  `memberid` int(11) DEFAULT NULL,
  `session_id` varchar(100) DEFAULT NULL,
  `config` text COMMENT 'special configurations',
  `created_by` int(11) DEFAULT NULL,
  `created_on` datetime DEFAULT NULL,
  `modified_by` int(11) DEFAULT NULL,
  `modified_on` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `NewIndex2` (`email`),
  UNIQUE KEY `NewIndex1` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `ae_users` */

/*Table structure for table `ae_users_login` */

CREATE TABLE `ae_users_login` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL,
  `login_time` datetime DEFAULT NULL,
  `logout_time` datetime DEFAULT NULL,
  `session_id` char(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `ae_users_login` */

/*Table structure for table `ae_usertypes` */

CREATE TABLE `ae_usertypes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type_desc` char(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

